import styles from './dialogCustom.scss';
class DialogCustom extends HTMLElement {
    constructor() {
        super();

        setTimeout(() => {
            const template = document.createElement('template');
            template.innerHTML = `
            <style>${styles.toString()}</style>
            <div class='t-dialog-custom'>
                
            </div>
            `;
            // this.attachShadow({ mode: 'open' });
            this.appendChild(template.content.cloneNode(true));

            if (this.querySelector('t-dialog-header')) {
                let divTab = document.createElement('div');
                divTab.className = `t-dialog-header`;

                // let titleTab = document.createElement('div');
                // titleTab.className = `t-dialog-title`;
                // divTab.appendChild(titleTab);

                // let actionTab = document.createElement('div');
                // actionTab.className = `t-dialog-action`;
                // divTab.appendChild(actionTab);

                if (this.querySelector('t-dialog-header').querySelector('t-dialog-title')) {
                    divTab.appendChild(this.querySelector('t-dialog-header').querySelector('t-dialog-title'));

                    if (this.querySelector('t-dialog-header').getAttribute('close') == 'true') {
                        let actionTab = document.createElement('t-dialog-action');
                        let closeButton = document.createElement('t-button')
                        closeButton.setAttribute('icon', 'data:image/png;base64,');
                        closeButton.setAttribute('sm', '');
                        // closeButton.setAttribute('primary');
                        closeButton.setAttribute("id", 'dialog-close');
                        actionTab.appendChild(closeButton);
                        divTab.appendChild(actionTab);
                    } else {
                        if (this.querySelector('t-dialog-header').querySelector('t-dialog-action')) {
                            divTab.appendChild(this.querySelector('t-dialog-header').querySelector('t-dialog-action'));
                        }
                    }
                    // if (this.querySelector('t-dialog-header').querySelector('t-dialog-action')) {
                    //     divTab.appendChild(this.querySelector('t-dialog-header').querySelector('t-dialog-action'));
                    // }
                } else {
                    divTab.appendChild(this.querySelector('t-dialog-header'));
                }
                this.querySelectorAll(".t-dialog-custom")[0].appendChild(divTab);
            }
            if (this.querySelector('t-dialog-content')) {
                let divTab = document.createElement('div');
                divTab.className = `t-dialog-content`;
                divTab.appendChild(this.querySelector('t-dialog-content'));
                this.querySelectorAll(".t-dialog-custom")[0].appendChild(divTab);
            }
            if (this.querySelector('t-dialog-footer')) {
                let divTab = document.createElement('div');
                divTab.className = `t-dialog-footer`;
                if (this.querySelector('t-dialog-footer').hasAttribute('cancel')) {
                    let closeButton = document.createElement('t-button');
                    closeButton.setAttribute("id", 'dialog-cancel');
                    closeButton.setAttribute('sm', '');
                    closeButton.innerText = this.querySelector('t-dialog-footer').getAttribute('cancel');
                    divTab.appendChild(closeButton);
                }
                if (this.querySelector('t-dialog-footer').hasAttribute('submit')) {
                    let submitButton = document.createElement('t-button');
                    submitButton.setAttribute("id", 'dialog-submit');
                    submitButton.setAttribute('sm', '');
                    submitButton.setAttribute('primary', '');
                    submitButton.innerText = this.querySelector('t-dialog-footer').getAttribute('Submit');
                    divTab.appendChild(submitButton);
                }
                if (!this.querySelector('t-dialog-footer').hasAttribute('cancel') && !this.querySelector('t-dialog-footer').hasAttribute('submit')) {
                    divTab.appendChild(this.querySelector('t-dialog-footer'));
                }

                /* let divTab = document.createElement('div');
                divTab.className = `t-dialog-footer`;
                divTab.appendChild(this.querySelector('t-dialog-footer')); */
                this.querySelectorAll(".t-dialog-custom")[0].appendChild(divTab);
            }

        }, 0);
    }

    disconnectedCallback() {

    }

    sendtoApp(buttonType) {
        this.dispatchEvent(new CustomEvent("tdialogcustom", {
            bubbles: true,
            detail: {
                version: '2.2.21',
                method: this.getAttribute("callback"),
                params: '',
                data: {
                    type: buttonType
                }
            }
        }));

    }

    connectedCallback() {
        setTimeout(() => {
            // let callbackName = this.hasAttribute("callback");
            // if (callbackName) {
            if (this.querySelector('#dialog-close')) {
                this.querySelector('#dialog-close').addEventListener('click', (ele) => {
                    this.sendtoApp('close');
                });
            }
            if (this.querySelector('#dialog-cancel')) {
                this.querySelector('#dialog-cancel').addEventListener('click', (ele) => {
                    this.sendtoApp('cancel');
                });
            }
            if (this.querySelector('#dialog-submit')) {
                this.querySelector('#dialog-submit').addEventListener('click', (ele) => {
                    this.sendtoApp('submit');
                });
            }
            // }
        }, 0);

    }



    static get observedAttributes() {
        return ['theme'];
    }

    attributeChangedCallback(name, oldValue, newValue) {
        console.log("attributeChangedCallback cutsom-> ", name, oldValue, newValue);
        setTimeout(() => {
            if (name == 'theme' && newValue) {
                console.log("this", this);
                if (this) {
                    let tag = this.querySelectorAll('.t-dialog-custom')[0];
                    console.log("tag tag", tag);
                    if (tag) {
                        if (oldValue) {
                            tag.classList.remove(oldValue);
                        }
                        tag.classList.add(newValue);
                    }
                }
            }
        }, 0);

    }
}
export default DialogCustom;